CommonData.BannerCustomCSS:
#onetrust-banner-sdk,
#onetrust-consent-sdk {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
}

#onetrust-banner-sdk #onetrust-policy {
  margin: 1em;
}

#onetrust-banner-sdk #onetrust-accept-btn-handler,
#onetrust-banner-sdk #onetrust-reject-all-handler {
  border-radius: 4px;
  font-weight: bold;
}

#onetrust-banner-sdk #onetrust-button-group-parent #onetrust-button-group #onetrust-reject-all-handler {
  display: none;
}

html.userconsent-cntry-de #onetrust-banner-sdk #onetrust-button-group-parent #onetrust-button-group #onetrust-reject-all-handler,
html.userconsent-cntry-fr #onetrust-banner-sdk #onetrust-button-group-parent #onetrust-button-group #onetrust-reject-all-handler {
  display: unset;
}

#onetrust-consent-sdk #onetrust-pc-sdk button {
  font-weight: bold;
}

#onetrust-consent-sdk #onetrust-pc-sdk #accept-recommended-btn-handler {
  background-color: #4285f4;
  border: none;
  border-radius: 4px;
  color: #ffffff;
  -webkit-box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.6);
  -moz-box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.6);
  box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.6);
}

#onetrust-banner-sdk a,
#onetrust-pc-sdk a,
#ot-sdk-cookie-policy a {
  font-family: sans-serif;
  color: #D9D9D9;
}

@media only screen and (min-width: 426px) and (max-width: 896px) {
  #onetrust-banner-sdk #onetrust-group-container {
    width: 100%;
  }
}

@media only screen and (min-width: 550px) {
  #onetrust-banner-sdk #onetrust-group-container {
    width: 100% !important;
  }
}

@media only screen and (min-width: 769px) {
  #onetrust-banner-sdk #onetrust-button-group {
    margin-right: 0;
  }
}

@media only screen and (min-width: 896px) {
  #onetrust-banner-sdk #onetrust-group-container {
    width: 80% !important;
  }

  #onetrust-banner-sdk #onetrust-button-group-parent {
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    width: auto;
    right: 2em;
  }

  #onetrust-banner-sdk #onetrust-button-group {
    display: inline;
  }
}

@media only screen and (min-width: 1024px) {
  #onetrust-banner-sdk #onetrust-group-container {
    width: 80% !important;
  }

  #onetrust-banner-sdk.vertical-align-content #onetrust-button-group-parent {
    width: auto;
    left: auto;
    right: 2em;
  }

  #onetrust-banner-sdk #onetrust-reject-all-handler,
  #onetrust-consent-sdk #onetrust-accept-btn-handler,
  #onetrust-consent-sdk #onetrust-pc-btn-handler {
    margin-right: 0;
  }
}

#onetrust-banner-sdk.ot-iab-2 .onetrust-vendors-list-handler {
    display: unset;
}

#onetrust-banner-sdk #onetrust-policy-text a {
    margin-left: 0px;
}

CommonData.PCCustomCSS:
#optanon #optanon-popup-wrapper,
#optanon #optanon-popup-bg {
  z-index: 9999999999;
}

.optanon-alert-box-wrapper {
  z-index: 99999;
}

#optanon *,
.optanon-alert-box-wrapper * {
  font-family: CNN,CNNSans,Helvetica Neue,Helvetica,Arial,sans-serif !important;
  text-size-adjust: 100%;
  -webkit-text-size-adjust: 100%;
}

.optanon-alert-box-wrapper .optanon-alert-box-bg p {
    font-size: 14px;
    line-height: 1.62;
}

.optanon-alert-box-wrapper .optanon-button-more .optanon-alert-box-button-middle a {
    border-bottom: none;
}

.optanon-alert-box-wrapper .optanon-button-allow .optanon-alert-box-button-middle a:before,.optanon-alert-box-wrapper .optanon-button-more .optanon-alert-box-button-middle a:before {
    display: none;
}

.optanon-alert-box-wrapper .optanon-alert-box-button-middle {
    border-radius: 4px;
}

.optanon-alert-box-wrapper .optanon-alert-box-bg p a {
    border-bottom: 1px solid #ff3f3f;
    color: #D9D9D9;
}

.optanon-alert-box-wrapper .optanon-alert-box-bg p a:hover {
border-bottom-color: transparent;
    color: #ff3f3f;
}

.optanon-alert-box-wrapper .optanon-alert-box-corner-close a {
    background: #262626;
}

#optanon #optanon-popup-top .optanon-close {
    background: #fff;
    right: 16px;
    top: 28px;
}

#optanon #optanon-popup-top .optanon-close:before,
#optanon #optanon-popup-top .optanon-close:after,
.optanon-alert-box-wrapper .optanon-alert-box-corner-close a:before,
.optanon-alert-box-wrapper .optanon-alert-box-corner-close a:after {
    content: '';
    height: 22px;
    border-left: 2px solid #fff;
    position: absolute;
    left: 10px;
}

#optanon #optanon-popup-top .optanon-close:before,
.optanon-alert-box-wrapper .optanon-alert-box-corner-close a:before {
    transform: rotate(-45deg);
}

#optanon #optanon-popup-top .optanon-close:after,
.optanon-alert-box-wrapper .optanon-alert-box-corner-close a:after {
    transform: rotate(45deg);
}

#optanon #optanon-popup-top .optanon-close:before,
#optanon #optanon-popup-top .optanon-close:after {
    border-left-color: #262626;
}

#optanon #optanon-menu li {
    background: none !important;
}

#optanon #optanon-menu li p {
    margin-left: 16px;
}

#optanon #optanon-main-info-text a {
    text-decoration: underline;
}

.optanon-alert-box-wrapper .banner-content .banner-policy-link {
text-decoration: none !important;
}

#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-left,
#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-middle,
#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-right {
  background-color: #3061F3 !important;
border-radius: 4px;
-webkit-box-shadow: 0px 0px 3px 0px rgba(0,0,0,0.6);
-moz-box-shadow: 0px 0px 3px 0px rgba(0,0,0,0.6);
box-shadow: 0px 0px 3px 0px rgba(0,0,0,0.6);
}

#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-middle {
padding: 8px 18px;
}
#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-middle button {
  color: #ffffff !important;
  font-size: 13px;
}
#optanon #optanon-popup-wrapper .optanon-allow-all-button .optanon-white-button-middle button:before {
  content: "\2713";
  padding-right: 3px;
}
@media only screen and (max-width: 47em) {
.optanon-alert-box-bg .optanon-alert-box-button-container {
  padding-right: 0;
}
.optanon-alert-box-wrapper .optanon-alert-box-button {
  float: none;
  margin: 10px auto;
}
}
#onetrust-consent-sdk #onetrust-pc-sdk .ot-leg-btn-container .ot-remove-objection-handler {
background-color: #FFFFFF !important;
color: #000000 !important; 
}
#onetrust-consent-sdk div#ot-sdk-btn-floating {
    display: none !important;
}

#onetrust-pc-sdk #manage-cookies-text {
    font-size: 1em;
}

#onetrust-consent-sdk .ot-sdk-container .ot-main-content .save-preference-btn-container .ot-pc-refuse-all-handler {
  display: none;
}

html.userconsent-cntry-de #onetrust-consent-sdk .ot-sdk-container .ot-main-content .save-preference-btn-container .ot-pc-refuse-all-handler,
html.userconsent-cntry-fr #onetrust-consent-sdk .ot-sdk-container .ot-main-content .save-preference-btn-container .ot-pc-refuse-all-handler {
  display: unset;
}
